import React, { useState, useEffect } from 'react';
import Box from "@mui/material/Box";
import { useTheme } from "@mui/material";
import { DataGrid } from "@mui/x-data-grid";



const Sql2022 = () => {
	const theme = useTheme();
	const colors = tokens(theme.palette.mode);
	const [database, setDatabase] = useState([]);
	useEffect(() => {
		fetch('http://localhost:8082/release2022')
			.then((response) => response.json())
			.then((data) => {
				console.log(data);
				setDatabase(data);
			})
			.catch((err) => {
				console.log(err.message);
			});
	}, []);
	
		
	const columns = [
		
		{
			field: "knowledge_id",
			headerName: "knowledge_id",
			flex: 1,
			cellClassName: "name-column--cell",
		},
		{
			field: "product_version_id",
			headerName: "product_version_id",
			headerAlign: "left",
			align: "left",
		},
		{
			field: "knowledge_number",
			headerName: "knowledge_number",
			flex: 1,
		},
		{
			field: "build_number",
			headerName: "build_number",
			flex: 1,
		},
		{
			field: "file_version",
			headerName: "file_version",
			flex: 1,
		},
		{
			field: "release_date",
			headerName: "release_date",
			flex: 1,
		},
		{
			field: "kb_url",
			headerName: "kb_url",
			flex: 1,
		},
		{
			field: "kb_details",
			headerName: "kb_details",
			flex: 1,
		},
		


	];

	return (
		<Box m="20px">

			<Box
				m="40px 0 0 0"
				height="75vh"
				sx={{
					"& .MuiDataGrid-root": {
						border: "none",
					},
					"& .MuiDataGrid-cell": {
						borderBottom: "none",
					},
					"& .name-column--cell": {
						color: colors.blueAccent[300],
					},
					"& .MuiDataGrid-columnHeaders": {
						backgroundColor: colors.blueAccent[900],
						borderBottom: "none",
					},
					"& .MuiDataGrid-virtualScroller": {
						backgroundColor: colors.primary[400],
					},
					"& .MuiDataGrid-footerContainer": {
						borderTop: "none",
						backgroundColor: colors.blueAccent[900],
					},
					"& .MuiCheckbox-root": {
						color: `${colors.greenAccent[200]} !important`,
					},
				}}
			>
				<DataGrid  rows={database} columns={columns} />
			</Box>
		</Box>
	);
};

export default Sql2022;
